class AboutMe extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            isLoading: true
        }
    }

    componentDidMount() {
        fetch('https://sw-info-api.herokuapp.com/v1/peoples/1')
            .then(response => response.json())
    }

    render() {
       return (
           <div>
               <p>name</p>
               <p>height</p>
               <p>birth year</p>
               <p>gender</p>
               <p>mass</p>
               <p>hair color</p>
               <p>skin color</p>
               <p>eye color</p>
           </div>
       );
   }
};

export default AboutMe;
